import React from 'react';
import { Text } from 'react-native';

import { storiesOf } from '@storybook/react-native';
import { action } from '@storybook/addon-actions';
import { linkTo } from '@storybook/addon-links';

//import Button from './Button';
import CenterView from './CenterView';
import Welcome from './Welcome';
import Canvas from './Canvas';

const categoryArray = [
  {id: '1' ,name: 'Table', category: 'Furniture',image:'https://homepages.cae.wisc.edu/~ece533/images/airplane.png'},
  {id: '2' ,name: 'Chair', category: 'Furniture',image:'https://homepages.cae.wisc.edu/~ece533/images/boat.png'},
  {id: '3' ,name: 'Door', category: 'Furniture',image:'https://homepages.cae.wisc.edu/~ece533/images/cat.png'},

  {id: '4' ,name: 'TV', category: 'Electronics',image:'https://homepages.cae.wisc.edu/~ece533/images/airplane.png'},
  {id: '5' ,name: 'Camera', category: 'Electronics',image:'https://homepages.cae.wisc.edu/~ece533/images/boat.png'},
  {id: '6' ,name: 'Mobile', category: 'Electronics',image:'https://homepages.cae.wisc.edu/~ece533/images/cat.png'}]

storiesOf('Canvas', module).add('to Storybook', () => <Canvas/>);

storiesOf('Button', module)
  .addDecorator((getStory) => <CenterView>{getStory()}</CenterView>)
  .add('with text', () => (
    <Button onPress={action('clicked-text')}>
      <Text>Hello Button</Text>
    </Button>
  ))
  .add('with some emoji', () => (
    <Button onPress={action('clicked-emoji')}>
      <Text>😀 😎 👍 💯</Text>
    </Button>
  ));
